try {
  if (typeof path === 'undefined') {
    const path = require('path')
  }
  if (typeof fs === 'undefined') {
    const fs = require('fs')
  }
  const js = ''
  if (typeof js === 'undefined') {
    if (!fs.existsSync(path.join(app.vault.adapter.getBasePath(), 'z_Scripts/JS/initScript.js'))) {
      throw new Error('initScript.js not found')
    }
    const js = fs.readFileSync(path.join(app.vault.adapter.getBasePath(), 'z_Scripts/JS/initScript.js'))
  }

  if (js === '') {
    throw new Error('initScript.js is empty')
  }
  eval(js)
} catch (e) {
  console.log(`Error running Javascript Init script: ${e.message}`)
  new Notice(`Error running Javascript Init script: ${e.message}`)
}
